import React from "react";
import getImg from "../../Utils/getImg";
import "./Header.scss";

const Header = (props) => {
  function logout() {
    sessionStorage.setItem("loggedIn", "false");
    props.goto("/");
  }

  return (
    <>
      <div className="sa-header-w">
        <div className="sa-header-tabs-w">
          {window["detectMob"]() ? (
            <img src={getImg("MENU.svg")} onClick={props.setOpenMenu} />
          ) : null}
        </div>
        <div
          className="sa-header-profile-section"
          onClick={() => {
            props.setUserType("", "");
            sessionStorage.setItem("loggedIn", "false");
          }}
        >
          Logout
        </div>
      </div>
    </>
  );
};

export default Header;
